using EncodedComparer.Domain.Entities;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using System.Linq;

namespace EncodedComparer.Tests.Unit.Entities
{
    [TestClass]
    public class EncodedPairTests
    {
        private const string ValidBase64 = "ew0KICAgICJnbG9zc2FyeSI6IHsNCiAgICAgICAgInRpdGxlIjogImV4YW1wbGUgZ2xvc3NhcnkiDQogICAgIH0NCn0=";
        private const string ValidSameSizeDifferentBase64 = "1234ICAgICJnbG9zc2FyeSI6IHsNCiAgICAgICAgInRpdGxlIjogImV4YW1wbGUgZ2xvc3NhcnkiDQogICAgIH0NCn0=";
        private const string SmallerValidBase64 = "ICAgICJnbG9zc2FyeSI6IHsNCiAgICAgICAgInRpdGxlIjogImV4YW1wbGUgZ2xvc3NhcnkiDQogICAgIH0NCn0=";
        private const string ReallyBigBase64    = "";
        private const string FourDiffsBigBase64 = "";
        private readonly Base64Data _validBase64Data = new Base64Data(1, ValidBase64);
        private readonly Base64Data _validSameSizeDifferentBase64Data = new Base64Data(1, ValidSameSizeDifferentBase64);
        private readonly Base64Data _smallerValidBase64Data = new Base64Data(1, SmallerValidBase64);
        private readonly Base64Data _bigValidBase64Data = new Base64Data(1, ReallyBigBase64);
        private readonly Base64Data _fourDiffsBigValidBase64Data = new Base64Data(1, FourDiffsBigBase64);


        [TestMethod]
        public void ShouldReturnNotificationWhenInstatiatedWithAnyNull()
        {
            var encodedPairNullNull = new EncodedPair(null, null);
            var encodedPairNullOk = new EncodedPair(null, _validBase64Data);
            var encodedPairOkNull = new EncodedPair(_validBase64Data, null);

            Assert.IsFalse(encodedPairNullNull.IsValid);
            Assert.AreEqual(1, encodedPairNullNull.Notifications.Count);

            Assert.IsFalse(encodedPairNullOk.IsValid);
            Assert.AreEqual(1, encodedPairNullOk.Notifications.Count);

            Assert.IsFalse(encodedPairOkNull.IsValid);
            Assert.AreEqual(1, encodedPairOkNull.Notifications.Count);
        }

        [TestMethod]
        public void ShouldReturnNotificationWhenFindingDiffWithNullOnLeftOrRight()
        {
            var encodedPairNullNull = new EncodedPair(null, null);
            var differences = encodedPairNullNull.FindDifferences();
          
            Assert.IsFalse(encodedPairNullNull.IsValid);
            Assert.AreEqual(3, encodedPairNullNull.Notifications.Count);
            Assert.IsNull(differences);
        }

        [TestMethod]
        public void ShouldReturnNotificationWhenFindingDiffWithDifferemtSizedLeftAndRight()
        {
            var encodedPairNullNull = new EncodedPair(_validBase64Data, _smallerValidBase64Data);
            var differences = encodedPairNullNull.FindDifferences();

            Assert.IsFalse(encodedPairNullNull.IsValid);
            Assert.AreEqual(1, encodedPairNullNull.Notifications.Count);
            Assert.IsNull(differences);
        }


        [TestMethod]
        public void ShouldReturnFalseWhenLeftAndRigthAreNotSameSize()
        {
            var encodedPair = new EncodedPair(_validBase64Data, _smallerValidBase64Data);

            Assert.IsFalse(encodedPair.AreSameSize);
        }

        [TestMethod]
        public void ShouldReturnTrueWhenLeftAndRigthAreSameSize()
        {
            var encodedPair = new EncodedPair(_validBase64Data, _validBase64Data);

            Assert.IsTrue(encodedPair.AreSameSize);
        }

        [TestMethod]
        public void ShouldReturnFalseWhenLeftAndRigthAreNotTheSame()
        {
            var encodedPair = new EncodedPair(_validBase64Data, _validSameSizeDifferentBase64Data);

            Assert.IsFalse(encodedPair.AreExactlyEquals);
        }

        [TestMethod]
        public void ShouldReturnTrueWhenLeftAndRigthAreTheSame()
        {
            var encodedPair = new EncodedPair(_validBase64Data, _validBase64Data);

            Assert.IsTrue(encodedPair.AreExactlyEquals);
        }

        [TestMethod]
        public void ShouldReturnTrueWhenLeftAndRigthAreBigAndTheSame()
        {
            var encodedPair = new EncodedPair(_bigValidBase64Data, _bigValidBase64Data);

            Assert.IsTrue(encodedPair.AreExactlyEquals);
        }

        [TestMethod]
        public void ShouldReturnDifferencesWhenLeftAndRigthAreBigSameSizeButDifferent()
        {
            var encodedPair = new EncodedPair(_bigValidBase64Data, _fourDiffsBigValidBase64Data);
            var differences = encodedPair.FindDifferences().ToList();

            Assert.IsFalse(encodedPair.AreExactlyEquals);
            Assert.AreEqual(4, differences.Count);
        }
    }
}
